SELECT ( GROUP_CONCAT( DISTINCT ?occupationLabel ; SEPARATOR = ', ' ) AS ?occupations ) ( SAMPLE( ?dateOfBirth ) AS ?dateOfBirth ) ( SAMPLE( ?placeOfBirthLabel ) AS ?placeOfBirth ) ( SAMPLE( ?countryOfCitizenshipLabel ) AS ?countryOfCitizenship ) WHERE {
