        ?placeOfBirth rdfs:label ?placeOfBirthLabel FILTER ( LANG( ?placeOfBirthLabel ) = 'en' )
      }
      wd:Q133622 wdt:P27 ?countryOfCitizenship .
      OPTIONAL {
        ?countryOfCitizenship rdfs:label ?countryOfCitizenshipLabel FILTER ( LANG( ?countryOfCitizenshipLabel ) = 'en' )
      }
    }
  }
}
